import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Home from './components/Home';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Switch>
          <Route path="/" component={Home} />
          <Route exact path="/p/:uuid" render={({match}) => <PokeDetail uuid={match.params.uuid}/>} />
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
